function extractCode(data) {
  if (data.length > 0) {
    return data[0].code;
  }
}

 return {"hs_code": extractCode(data)};

function extractUserData(data, hs_code, cargo_weight_per_container, containers_count) {
  if (data.length > 0) {
    var user_data = data[0].user_data;

    if (user_data && user_data.parameters_to_be_amended) {
      var parameters = user_data.parameters_to_be_amended;
      var configs_amendment_prefill = [];

      for (var param in parameters) {
        if (parameters.hasOwnProperty(param) && parameters[param].hasOwnProperty('inventory_value')) {
          var hash = {
            "shipment_type": param,
            "chargeable_weight": parameters[param].inventory_value
          };

          if (param === 'hs_code') {
            hash["total_weight"] = hs_code[0].code;
          } else if (param === 'cargo_weight_change') {
            hash["total_weight"] = cargo_weight_per_container;
          } else if (param === 'containers_count') {
            hash["total_weight"] = containers_count;
          }

          configs_amendment_prefill.push(hash);
        }
      }

      return configs_amendment_prefill;
    }
  }

  return [];
} 


return {"configs_amendment_prefill": extractUserData(data, hs_code, cargo_weight_per_container, containers_count)}

